// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract simpleAuction {
    //variable
    address payable public beneficiary;
    uint PriceStart;
    uint public auctionEndTime;
    uint public highestBid;
    address public highestBidder;

    bool ended = false;

    mapping(address => uint) public pendingReturns;

    event highestBidIncrease(address bidder, uint amount);
    event auctionEnded(address winner, uint amount);

    constructor (uint _biddingTime, address payable _beneficiary, uint _PriceStart){
        beneficiary = _beneficiary;
        auctionEndTime = block.timestamp + _biddingTime;
        PriceStart = _PriceStart;
    }
    
    function bid() public payable {
        if (block.timestamp > auctionEndTime ){
            revert("Phien dau gia ket thuc");
        }

        if (msg.value <= highestBid){
            revert("Gia cua ban thap hon gia cao nhat");
        }

        if (highestBid != 0){
            pendingReturns[highestBidder] += highestBid;
        }

        if (msg.value < PriceStart ){
            revert("Gia cua ban phai cao hon gia khoi diem");
        }
        
        highestBidder = msg.sender;
        highestBid = msg.value;
        emit highestBidIncrease(msg.sender, msg.value);
    }

    function withdraw() public returns(bool){
        uint amount = pendingReturns[msg.sender];
        if (amount > 0){
            pendingReturns[msg.sender] == 0;

            if(payable(msg.sender).send(amount)){
                pendingReturns[msg.sender] = amount;
                return false;
            }
        }
        return true;
    }

    function auctionEnd() public{
        if (ended){
            revert("Phien dau gia da co the ket thuc");
        }
        if(block.timestamp < auctionEndTime){
            revert("Phien dau gia chua ket thuc");
        }

        ended = true;
        emit auctionEnded(highestBidder, highestBid);

        beneficiary.transfer(highestBid);
    }

    function getBalance() public view returns(uint){
        return address(this).balance;
    }
}
